--
-- Table structure for table `master_user`
--

DROP TABLE IF EXISTS `master_user`;
CREATE TABLE IF NOT EXISTS `master_user` (
  `id` int NOT NULL AUTO_INCREMENT,
  `session_id` varchar(50) DEFAULT NULL,
  `is_logout` tinyint(1) NOT NULL DEFAULT '0',
  `hashtag` varchar(16) DEFAULT NULL,
  `userid` varchar(30) DEFAULT NULL,
  `category` int UNSIGNED NOT NULL,
  `email` varchar(100) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `mobile` varchar(20) NOT NULL,
  `full_name` varchar(30) DEFAULT NULL,
  `first_name` varchar(20) NOT NULL,
  `last_name` varchar(20) NOT NULL,
  `gender` varchar(20) DEFAULT NULL,
  `profile_image` varchar(255) NOT NULL,
  `google_id` varchar(255) DEFAULT NULL,
  `twitter_id` varchar(255) DEFAULT NULL,
  `fb_id` varchar(255) DEFAULT NULL,
  `linkedin_id` varchar(255) DEFAULT NULL,
  `insta_id` varchar(255) DEFAULT NULL,
  `is_confirmed` tinyint UNSIGNED NOT NULL DEFAULT '0',
  `admin_approve` tinyint DEFAULT '0',
  `created_at` datetime NOT NULL,
  `updated_at` datetime DEFAULT NULL,
  `info` text NOT NULL,
  `parent_userid` varchar(255) DEFAULT NULL,
  `parent_password` varchar(255) DEFAULT NULL,
  `show_slider` tinyint(1) DEFAULT '0',
  `limit_balance_negative_amt` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_usercat` (`category`)
) ENGINE=InnoDB AUTO_INCREMENT=1040 DEFAULT CHARSET=latin1;

